import React from 'react';
import { MDBContainer } from 'mdb-react-ui-kit';
import NavBar from './components/NavBar';
import Body from './components/Body';

function App() {
  return (
    <MDBContainer fluid style={{minHeight:'100vh ps-0', background: '#F5F5F5'}}>
      <NavBar/>
      <Body/>
    </MDBContainer>
  );
}

export default App;
